import React, { Component } from 'react';
import TodoItem from '../TodoItem';

class TodoList extends Component {
  render() {
    return (
      <div>
        <TodoItem done>assadsads</TodoItem>
        <TodoItem>ssdd</TodoItem>

      </div>
    );
  }
}

export default TodoList;
